import {useState, useEffect} from "react";

function UserList(props) {
  const [userList, setUserList] = useState(props.userList);

  const userItem = userList.map((item) => (
    <tr>
      <td>item.id</td>
      <td>item.name</td>
      <td>item.year</td>
    </tr>
  ));

  return (
    <div>
      <div>User List:</div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>{userItem}</tbody>
      </table>
    </div>
  );
}

export default UserList;
